import React, { useState } from "react";
import "./dream-bubble.css";

export default function DreamBubble(props) {
  return (
    <div onClick={() => props.updateContent(props.title)} className="titleContainer" >
      <a href={"#" + props.title}><h5 className='labelStyle'>
        {props.title}
      </h5 ></a>
    </div>
  )
}
